import React, { Component } from "react";
import PlantItem from "./PlantItem";

export default class Cart extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  cartStyle = { display: "flex", flexWrap: "wrap", gap: 15 };

  render() {
    return (
      <div style={this.cartStyle}>
        {this.props.totalPrice}
        <div></div>

      </div>
    );
  }
}
